INSERT INTO `sub_events` VALUES (414,229,'Вступительное слово председателя Совета \nВоенного инновационного технополиса «Эра» Ю.И.БОРИСОВА','2020-11-20 08:12:00','2020-11-20 08:50:00','-',NULL,'2020-11-20 08:01:20'),(415,229,'Информационное сообщение.\nОтветственный секретарь Совета Военного инновационного технополиса «Эра» М.В.ОСЫКО ','2020-11-20 09:05:00','2020-11-20 09:08:00','-',NULL,'2020-11-20 08:01:20'),(416,229,'О ходе разработки проекта федерального закона «О Военном инновационном технополисе «Эра». Министерства обороны Российской Федерации» Начальник Главного управления научно-исследовательской деятельности и технологического сопровождения передовых технологий (инновационных исследований) Министерства обороны Российской Федерации генерал-майор А.М.ГОНЧАРОВ','2020-11-20 09:08:00','2020-11-20 09:15:00','-',NULL,'2020-11-20 08:01:20'),(417,229,'Организация работы дизайн-центров микроэлектроники, размещенных на базе Технополиса, порядок реализации результатов их деятельности при создании образцов вооружения, военной и специальной техники и продукции двойного назначения.\nВ.В.ШПАК','2020-11-20 09:15:00','2020-11-20 09:20:00','-',NULL,'2020-11-20 08:01:21'),(418,229,'Организация взаимодействия с Технополисом при проведении совместных научных исследований и разработок предприятий и организаций, входящих в государственную корпорацию «Росатом». А.В.БАХИН','2020-11-20 09:20:00','2020-11-20 09:25:00','-',NULL,'2020-11-20 08:01:21'),(419,229,'Промежуточные результаты работы Центра компетенций цифровых двойников Технополиса «Эра». Руководитель Центра компетенций цифровых двойников «ОПК 4.0» Институт цифровой трансформации ОПК» Е.А.МИРОШНИЧЕНКО','2020-11-20 09:25:00','2020-11-20 09:30:00','-',NULL,'2020-11-20 08:01:21'),(420,229,'Рассмотрение заявок научных организаций \nи предприятий промышленности на получение ими статуса участника Технополиса\nИо генерального директора, заместитель генерального директора по НИОКР АО «Научно-производственный комплекс «Дедал» (предприятие Государственной корпорации по атомной энергии «Росатом») С.А.КОЗЛОВ','2020-11-20 09:30:00','2020-11-20 09:35:00','-',NULL,'2020-11-20 08:01:21'),(421,229,'Генеральный директор АО «Рязанский радиозавод» Ю.Л. СМИРНОВ','2020-11-20 09:35:00','2020-11-20 09:40:00','-',NULL,'2020-11-20 08:01:21'),(422,229,'Заместитель генерального директора по научно-техническому развитию АО «Рязанский радиозавод» С.В.СЕРЕДЕНКО','2020-11-20 09:40:00','2020-11-20 09:45:00','-',NULL,'2020-11-20 08:01:22'),(423,229,'Заключительное слово председателя Совета Военного инновационного технополиса «Эра», Заместителя Председателя Правительства Российской Федерации Ю.И.БОРИСОВА','2020-11-20 09:45:00','2020-11-20 09:50:00','-',NULL,'2020-11-20 08:01:22'),(424,229,'Завершение заседания Совета Военного инновационного технополиса «ЭРА».','2020-11-20 09:50:00','2020-11-20 09:55:00','-',NULL,'2020-11-20 08:01:22'),(425,231,'Вступительное слово генерала-лейтенанта Владимира Сергеевича Ивановского, начальника Военного инновационного технополиса «ЭРА» ','2020-11-20 11:05:00','2020-11-20 11:08:00','-',NULL,'2020-11-20 08:01:23'),(426,231,'Доклад руководителя группы Шамрея Владислава Казимировича: «Программно-аппаратный комплекс для биометрической видеорегистрации мимических и пантомических реакций обследуемого («МИКС ВР19»)», ','2020-11-20 11:08:00','2020-11-20 11:11:00','-',NULL,'2020-11-20 08:01:23'),(427,231,'Доклад руководителя группы Марченко Андрея Александровича: «Программный комплекс нейрокогнитивного обследования»','2020-11-20 11:11:00','2020-11-20 11:14:00','Каб. 834',NULL,'2020-11-20 08:01:23'),(428,231,'Доклад руководителя группы Иванова Андрея Михайловича: «Разработка алгоритма проведения секвенирования генов hla 1 и 2 классов с целью повышения эффективности оказания высокотехнологичной помощи, шифр «Ген-ЭРА»','2020-11-20 11:14:00','2020-11-20 11:17:00','Каб. 829, 831',NULL,'2020-11-20 08:01:23'),(429,231,'Доклад руководителя группы Криворучко Александра Борисовича: «Исследование по созданию бесклеточного матрикса пуповины для тканеинженерного раневого покрытия и гидрогеля для регенеративной медицины, шифр «Аккорд-ЭРА»','2020-11-20 11:17:00','2020-11-20 11:20:00','Каб. 833, 837',NULL,'2020-11-20 08:01:23'),(430,231,'Доклад руководителя группы Маньшева Дмитрия Альевича: «Топливо для эксплуатации в экстремальных условиях»','2020-11-20 11:20:00','2020-11-20 11:23:00','Каб. 504',NULL,'2020-11-20 08:01:23'),(431,231,'Доклад руководителя группы Нелюба Владимира Александровича: «Лопатка газотурбинного двигателя из полимерных композиционных материалов»','2020-11-20 11:23:00','2020-11-20 11:26:00','Каб. 505',NULL,'2020-11-20 08:01:24'),(432,231,'Доклад руководителя группы полковника Шевченко Ярослава Владимировича: «Образцы керамо-титановой защиты и боевой экипировки для спецподразделений силовых ведомств РФ»','2020-11-20 11:26:00','2020-11-20 11:30:00','Каб. 512',NULL,'2020-11-20 08:01:24'),(433,231,'Доклад руководителя группы майора Поддубного Максима Игоревича : «Разработка программно-аппаратного комплекса поведенческого анализа пользователей сервисов электронного документооборота федеральных органов исполнительной власти на основе применения нейросетевых технологий»','2020-11-20 11:30:00','2020-11-20 11:35:00','Каб. 303, 304, 309, 310',NULL,'2020-11-20 08:01:24'),(445,253,'Пленарное заседание. «Состояние и перспективы развития боевой экипировки военнослужащих видов и родов войск ВС РФ. Состав комплектов боевой экипировки военнослужащих и общие требования к ним »','2020-11-20 11:00:00','2020-11-20 12:00:00','1к. 3 этаж большой зал',NULL,'2020-11-20 13:47:08'),(446,253,'Круглый стол №1 «Существующая система тактико-технических требований к элементам системы поражения боевой экипировки военнослужащих. Проблемные вопросы и пути их решения с учетом перспектив развития до 2035 года»','2020-11-20 12:00:00','2020-11-20 17:00:00','4к. 5 этаж к. 506',NULL,'2020-11-20 13:47:08'),(447,253,'Круглый стол №2 «Существующая система тактико-технических требований к элементам системы защиты боевой экипировки военнослужащих. Проблемные вопросы и пути их решения с учетом перспектив развития до 2035 года»','2020-11-20 12:00:00','2020-11-20 17:00:00','4к. 1 этаж к.113',NULL,'2020-11-20 13:47:08'),(448,253,'Круглый стол №3 «Существующая система тактико-технических требований к элементам системы жизнеобеспечения боевой экипировки военнослужащих. Проблемные вопросы и пути их решения с учетом перспектив развития до 2035 года»','2020-11-20 12:00:00','2020-11-20 17:00:00','4к. 3 этаж к.307 ',NULL,'2020-11-20 13:47:08'),(449,253,'Круглый стол №4 «Существующая система тактико-технических требований к элементам системы защиты систем управления и энергосбережения боевой экипировки военнослужащих. Проблемные вопросы и пути их решения с учетом перспектив развития до 2035 года»\n','2020-11-20 12:00:00','2020-11-20 17:00:00','4к. 4 этаж к.406',NULL,'2020-11-20 13:47:08'),(450,253,'Подведение итогов конференции','2020-11-20 17:00:00','2020-11-20 15:00:00','1к. 3 этаж большой зал',NULL,'2020-11-20 13:47:08'),(451,256,'Секция № 1 «Существующая нормативная правовая и нормативно-техническая база по созданию, развитию и применению робототехнических комплексов военного, двойного и специального назначения. Проблемные вопросы и пути их решения»','2020-11-30 07:00:00','2020-11-30 10:00:00','4к. 5 этаж к.506',NULL,'2020-11-20 13:47:08'),(452,256,'Секция № 3 «Испытания робототехнических комплексов военного, двойного и специального назначения. Требования, предъявляемые к экспериментально-испытательной базе»','2020-11-30 07:00:00','2020-11-30 10:00:00','4к. 4 этаж к.406 ',NULL,'2020-11-20 13:47:08'),(453,256,'Круглый стол № 2 «Робототехнические комплексы военного назначения. Направление создания и развития с учетом опыта их применения»','2020-11-30 07:00:00','2020-11-30 10:00:00','4к. 1 этаж к.113',NULL,'2020-11-20 13:47:08'),(454,256,'Подготовка и проведение военно-технического эксперимента «Построение системы освещения подводной обстановки на новых подходах с использованием РТК» ','2020-11-30 12:00:00','2020-11-30 17:00:00','4к. 4 этаж ЛИ 12',NULL,'2020-11-20 13:47:08'),(455,256,'Подведение итогов «V Всероссийской научно-практической конференции \"Роботизация Вооруженных сил Российской Федерации\"','2020-11-30 17:00:00','2020-11-30 15:00:00','1к. 3 этаж большой зал 1к.2 этаж круглый зал',NULL,'2020-11-20 13:47:08'),(456,260,'Секция № 2 «Состояние научно-технического задела для создания робототехнических комплексов военного, двойного и специального назначения. Проблемные вопросы и пути их решения»','2020-11-20 11:00:00','2020-11-20 17:00:00','1к. 3 этаж большой зал',NULL,'2020-11-20 13:47:09'),(457,260,'Круглый стол №1 «Техническое зрение в системах управления робототехнических комплексов военного, двойного и специального назначения. Проблемные вопросы и пути их решения»','2020-11-20 11:00:00','2020-11-20 17:00:00','4к. 1 этаж к.113',NULL,'2020-11-20 13:47:09');
